import '../../about.css';


const AboutText =() => {

return (
	<main className='content__intro'>
	<h1>Hi, my name is Dima and i'm Developrer</h1>
		<h3>Here I will tell you about myself!</h3>

			<p>As you already understood, my name is Dima, I am 29 years old at the time of writing this blog.
			More than five years my main job was coaching, I have coached people who are ready to compete.
			But this came to an end, more than 1.5 years, I've been programming So Mrs. doing active terekingom climbing.
			My friend and I are taking people to the mountains, "join us."
			And yet this blog will be more about my history and my journey into programming.
			</p>

			<p>Here is my technology stack that I managed to master</p>
	</main>
)
}

export default AboutText;
